● crearUsuario() › should return a user constructor that correctly builds user objects

  expect(received).toBe(expected) // Object.is equality

  Expected value to be:
    "jssamuel"
  Received:
    {"email": "samuel@email.com", "nombre": "Samuel", "password": "LoveJS", "usuario": "jssamuel"}

  Difference:

    Comparing two different types of values. Expected string but received object.

    10 | 		const Usuario = crearUsuario();
    11 | 		const user = new Usuario({usuario: 'jssamuel', nombre: 'Samuel', email: 'samuel@email.com', password: 'LoveJS' });
  > 12 | 		expect(user.usuario).toBe('jssamuel');
    13 | 		expect(user.nombre).toBe('Samuel');
    14 | 		expect(user.email).toBe('samuel@email.com');
    15 | 		expect(user.password).toBe('LoveJS');

    at Object.<anonymous> (06-JS-V/homework/tests/JSV.test.js:12:24)
